import CasesChart from './CaseChart';
import React from 'react';
import GeoChart from './GeoChart';
import Grid from '@material-ui/core/Grid';

const Graphs = ()=>{
    return(
        <div>
            <Grid
                container
                direction="row"
                justify="space-evenly"
                alignItems="center"
                >
                <CasesChart/>
                <GeoChart/>
            </Grid>
        </div>
    )
}

export default Graphs;
